On Spiritual Power, Spiritual Practice, listeners join this respected medical intuitive and bestselling author to explore the prayers, reflections, and other teachings she developed in her own spiritual practice. Through these daily disciplines - including two 40-minute meditations, one for morning and one for evening - anyone can learn to tap the wellsprings of love, faith, and trust that energize our spiritual potential. Enhanced features include video footage from Myss' Energetics of Healing, music from Glen Velez's Rhythms of the Chakras, a text interview with the author, and an electronic study guide.
